import React from 'react';

const Currency = ({ code, size="small" }) => {
  
  try {
    const iconsList = {
      USD: 'data:image/svg+xml;base64,',
      INR: 'data:image/svg+xml;base64,',
      EUR: 'data:image/svg+xml;base64,',
      GBP: 'data:image/svg+xml;base64,',
      RUB: 'data:image/svg+xml;base64,',
      KRW: 'data:image/svg+xml;base64,',
      CRC: 'data:image/svg+xml;base64,',
      VND: 'data:image/svg+xml;base64,',
      AWG: 'data:image/svg+xml;base64,',
      PYG: 'data:image/svg+xml;base64,',
      LAK: 'data:image/svg+xml;base64,',
      ITL: 'data:image/svg+xml;base64,',
      NGN: 'data:image/svg+xml;base64,',
      ILS: 'data:image/svg+xml;base64,',
      TWD: 'data:image/svg+xml;base64,',
      KZT: 'data:image/svg+xml;base64,',
      CPY: 'data:image/svg+xml;base64,',
      JPY: 'data:image/svg+xml;base64,',
      PHP:'data:image/svg+xml;base64,'
    }

    const sizes = { small: "32px", medium: '44px', large: '64px', xlarge: '100px' }
  

    const styles = {
      height: sizes[size]
    }

  
    let parsedCode = code.toUpperCase();

    return (
      <React.Fragment>
        {
          !iconsList[parsedCode] ?
            parsedCode
            :
            <img src={iconsList[parsedCode]} style={styles} alt={`${parsedCode} currency icon`} />
          
        }
      
      </React.Fragment>
    )
  }
  catch (err) {
   
    throw new Error("Please make sure you're passing in an code prop with a value") 
  }
}


export default Currency